import React from "react";
import { View, Text, Button } from "react-native";

const NoteList = () => {
  return (
    <View>
      <View style={styles.header}>
        <Text style={styles.textHeader}>GHI CHÚ</Text>
      </View>
      {/* Hiển thị danh sách ghi chú ở đây */}
      <View>
        <Text>Tên ghi chú</Text>
        <Text>Nội dung ghi chú</Text>
        <Text>Ngày tháng ghi chú</Text>
      </View>
      <Button
        style={styles.addButton}
        title="+ Mới"
        onPress={() => {
          /* Xử lý khi nhấn nút + mới */
        }}
      />
    </View>
  );
};
const styles = StyleSheet.create({
  header: {},
  textHeader: {
    fontSize: 20,
    fontWeight: "bold",
    textAlign: "center",
  },
  addButton: {
    padding: 10,
  },
});
export default NoteList;
